import React from "react";
import { Route } from "react-router-dom";

import Explore from "./components/explore.js";
import Navbar from "./components/navbar.js";

const App = () => {
    return (
        <div>
            <Navbar />
            <Route path="/explore">
                <Explore />
            </Route>
            <Route path="/create">
                <Create />
            </Route>
        </div>
    );
};

export default App;
